import React, { useState } from 'react';

import './App.css';

const App: React.FC = () => {
  const [name, setValue] = useState('abcset')


  return (
    <div className="App">
      <input 
        value={name}
        onChange={event => setValue(event.target.value)} />
    </div>
  );
}

export default App;
